import React from "react";
import { Typography, Box, Button, Avatar, Input } from "@material-ui/core";

const Index = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
<Box style={{  borderRadius: "5px",
    width: "350px",
    height: "340px",
    backgroundColor: "#F7F7F7",
    padding: "20px",
    margin: "80px"}}>

</Box>


    </div>
  );
};
export default Index;
